create database servicelist;
create table services(
service_id int not null auto_increment,
servicename varchar(100) not null,
responsetime float not null,
availability float not null,
throughput float not null,
successability float not null,
reliability float not null,
compliance float not null,
bestpractices float not null,
latency float not null,
constraint pk_services_service_id primary key (service_id)
);
select * from services;
select servicename,responsetime,availability,throughput,successability,reliability,compliance,bestpractices,latency from services;


